INSERT INTO `posts` VALUES (6,4,1,'2021-02-06 19:10:12',19,'comment','<r><p>A very nice webpage to do a plot of a given function.<br/>\n[<URL url=\"https://www.mathe-fa.de/pt\">https://www.mathe-fa.de/pt</URL>]</p></r>',NULL,NULL,NULL,NULL,'162.158.154.136',0,1),(7,4,2,'2021-02-09 15:31:33',33,'comment','<t><p>I have checked and confirm: cool!</p></t>',NULL,NULL,NULL,NULL,'141.101.104.142',0,1),(8,5,1,'2021-02-09 15:36:32',33,'comment','<r><p>Do you know how to interpret it?<br/>\nCheck this out: <br/>\n<URL url=\"https://youtu.be/qKyturOAD60\">https://youtu.be/qKyturOAD60</URL></p></r>','2021-02-11 16:56:49',33,NULL,NULL,'141.101.104.142',0,1),(9,4,3,'2021-02-10 15:45:46',1385,'comment','<r><p>I also like <URL url=\"www.geogebra.org\"><s>[</s>www.geogebra.org<e>](www.geogebra.org)</e></URL></p></r>',NULL,NULL,NULL,NULL,'172.69.190.31',0,1),(10,5,2,'2021-02-11 10:27:10',1383,'comment','<t><p>The webpage seems to be incorrect. I can\'t reach it.</p></t>',NULL,NULL,NULL,NULL,'172.69.190.77',0,1),(11,6,1,'2021-02-11 16:37:34',33,'comment','<t><p>Students who wish to discuss a topic not yet covered in the existing discussions are invited to propose it here.</p>\n</t>','2021-02-12 17:05:43',33,NULL,NULL,'172.68.94.145',0,1),(12,6,2,'2021-02-11 16:43:49',33,'comment','<t><p>I would like to know the formula for the square of a sum. Anyone?</p></t>',NULL,NULL,NULL,NULL,'172.68.94.157',0,1),(13,6,3,'2021-02-11 16:54:00',1355,'comment','<r><p>@<EMAIL email=\"pacheco@ipb.pt\">pacheco@ipb.pt</EMAIL>#12 <br/>\nI know that formula: (a+b)<SUP><s>^</s>2</SUP>=a<SUP><s>^</s>2</SUP>+2ab+b<SUP><s>^</s>2</SUP><br/>\nThe square of the sum of two numbers is equal to the square of the first number plus twice the product of the first by the second plus the square of the second number.</p></r>',NULL,NULL,NULL,NULL,'172.68.94.37',0,1),(14,5,3,'2021-02-11 16:55:48',1355,'comment','<r><p>You are right, please try this link:<br/>\n<URL url=\"https://youtu.be/qKyturOAD60\">https://youtu.be/qKyturOAD60</URL></p></r>',NULL,NULL,'2021-02-11 16:56:06',1355,'172.68.94.37',0,1),(15,5,4,'2021-02-11 16:57:17',33,'comment','<r><p>@<EMAIL email=\"lina.tarankeviciute@gmail.com\">lina.tarankeviciute@gmail.com</EMAIL>#10 <br/>\nThanks for letting me know. Please try this one.</p></r>',NULL,NULL,NULL,NULL,'172.68.94.37',0,1),(16,7,1,'2021-02-15 13:04:35',35,'comment','<t><p>Have any of you found really useful tools to help with your on-line learning? #on-line tools</p></t>',NULL,NULL,NULL,NULL,'141.101.76.71',0,1),(17,7,2,'2021-03-02 13:06:48',1355,'comment','<r><p>I usually use this site <br/>\n<URL url=\"https://www.khanacademy.org/\">https://www.khanacademy.org/</URL> <br/>\nbut maybe you meant apps, not sites...</p></r>',NULL,NULL,NULL,NULL,'188.114.111.234',0,1),(18,6,4,'2021-03-02 13:10:15',1355,'comment','<t><p>Why is pi so important in Mathematics? Can someone tell me a little about it?  I am not sure if I know &#128517;</p> </t>',NULL,NULL,NULL,NULL,'188.114.111.234',0,1),(19,5,5,'2021-03-03 07:06:21',1383,'comment','<t><p>Now it works. This is more memorable than just writing, suitable for those who have difficulty memorizing simple equations. Like it.</p></t>',NULL,NULL,NULL,NULL,'162.158.183.240',0,1),(20,7,3,'2021-03-03 10:56:20',35,'comment','<t><p>No sites as well as apps. Thanks for your suggestion - yes, Khan Academy is a wonderful resource!</p></t>',NULL,NULL,NULL,NULL,'162.158.154.166',0,1),(21,8,1,'2021-03-04 10:31:51',24,'comment','<r><p>Do you know of any online tools to solve linear systems online? Look at this one, do you know any better ones? <URL url=\"url\"><s>[</s>https://www.wolframalpha.com/calculators/system-equation-calculator<e>](url)</e></URL></p></r>',NULL,NULL,NULL,NULL,'141.101.76.149',0,1),(22,6,5,'2021-03-16 07:26:57',27,'comment','<r><p>@<EMAIL email=\"littleant7anos@gmail.com\">littleant7anos@gmail.com</EMAIL>#18 <br/>\nI recommend you to watch <URL url=\"https://youtu.be/7QOOqP3XQhA\"><s>[</s>a video<e>](https://youtu.be/7QOOqP3XQhA)</e></URL> about Number Pi , which includes scientific facts about this constant</p></r>',NULL,NULL,NULL,NULL,'162.158.183.240',0,1),(23,8,2,'2021-03-16 07:28:18',27,'comment','<r><p>@<EMAIL email=\"perego@dima.unige.it\">perego@dima.unige.it</EMAIL>#21 <br/>\nYes, <URL url=\"https://www.symbolab.com/solver/system-of-equations-calculator\"><s>[</s>Symbolab <e>](https://www.symbolab.com/solver/system-of-equations-calculator)</e></URL></p></r>',NULL,NULL,NULL,NULL,'162.158.183.146',0,1),(24,5,6,'2021-03-29 11:27:30',33,'comment','<t><p>I agree :-)</p></t>',NULL,NULL,NULL,NULL,'141.101.104.154',0,1),(27,10,1,'2021-04-01 14:11:39',35,'comment','<r><H3><s>### </s>Student Challenge</H3>\n<p>Have you tried the \'Birthday Problem\' <URL url=\"http://webspace.ship.edu/deensley/mathdl/stats/Birthday.html\">http://webspace.ship.edu/deensley/mathdl/stats/Birthday.html</URL> #Statistics #challenge</p></r>',NULL,NULL,NULL,NULL,'141.101.104.58',0,1),(28,6,6,'2021-04-13 14:21:43',1113,'comment','<r><p>why is the number of subsets given by 2<SUP><s>^</s>n</SUP> rule but not 3<SUP><s>^</s>n</SUP> or 4<SUP><s>^</s>n</SUP> for any number of elements inside the set?</p></r>',NULL,NULL,NULL,NULL,'108.162.229.223',0,1),(29,6,7,'2021-04-13 14:31:45',1119,'comment','<r><UPL-IMAGE content=\"123456.png\" size=\"12kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-04-13/1618324296-988496-123456.png\" uuid=\"2fd68c13-c5df-4308-ad1d-62df5ea9ed9c\"><s>[upl-image uuid=2fd68c13-c5df-4308-ad1d-62df5ea9ed9c size=12kB url=http://localhost/mathe/student-forum/public/assets/files/2021-04-13/1618324296-988496-123456.png]</s>123456.png<e>[/upl-image]</e></UPL-IMAGE>\n</r>',NULL,NULL,NULL,NULL,'108.162.229.65',0,1),(30,6,8,'2021-04-13 14:32:00',1079,'comment','<t><p>Can a given set be symmetric as well as anti-symmetric?</p></t>',NULL,NULL,NULL,NULL,'141.101.69.30',0,1),(31,6,9,'2021-04-13 14:33:51',33,'comment','<r><p>@<EMAIL email=\"a45740@alunos.ipb.pt\">a45740@alunos.ipb.pt</EMAIL>#30 Arjun, you mean \'can a given binary relation...\'?</p>\n</r>',NULL,NULL,NULL,NULL,'141.101.76.139',0,1),(32,6,10,'2021-04-13 14:36:30',1123,'comment','<t><p>For the gcd of two unknown numbers, whenever we use an extended euclidean algorithm then we always take a quotient as one right? So that remainder will be subtraction result of two unknown numbers.<br/>\nEg: gcd(3k + 2, 5k + 3) =&gt; 5k+3 = (3k+2).1 + (5k+3-3k-2) [In Extended Euclidean Algorithm]</p>\n\n</t>',NULL,NULL,NULL,NULL,'141.101.99.230',0,1),(33,6,11,'2021-04-13 14:39:38',1135,'comment','<t><p>How can you determine the equivalence class for any natural number?</p></t>',NULL,NULL,NULL,NULL,'141.101.99.116',0,1),(34,6,12,'2021-04-13 18:37:16',33,'comment','<r><p>@<EMAIL email=\"a46123@alunos.ipb.pt\">a46123@alunos.ipb.pt</EMAIL>#33 <br/>\nIt depends on the equivalence relation you are dealing with!<br/>\nPlease watch this:<br/>\n<URL url=\"https://www.youtube.com/watch?v=KvtLWgCTwn4\">https://www.youtube.com/watch?v=KvtLWgCTwn4</URL></p></r>',NULL,NULL,NULL,NULL,'141.101.104.108',0,1),(35,6,13,'2021-04-13 18:54:49',33,'comment','<r><p>@<EMAIL email=\"dhakalnikesh2001@gmail.com\">dhakalnikesh2001@gmail.com</EMAIL>#32 <br/>\nThe example you describe is not about \'the gcd of two unknown numbers\', it seems to be about finding the gcd of two numbers of a particular form.<br/>\nAll we can say is that 5k+3=(3k+2).1+(2k+1) and since k is integer, then also 3k+2 and 2k+1 are integer.<br/>\nIf the goal is finding gcd(3k + 2, 5k + 3), you need to continue with 3k+2=(2k+1).1+(k+1)    2k+1=(k+1).1+k    k+1=k.1+1   k=1.k+0 and, therefore, gcd(3k + 2, 5k + 3)=1.</p></r>',NULL,NULL,'2021-04-13 18:55:08',33,'141.101.104.204',0,1),(36,6,14,'2021-04-13 18:55:18',33,'comment','<r><p>@<EMAIL email=\"dhakalnikesh2001@gmail.com\">dhakalnikesh2001@gmail.com</EMAIL>#32 <br/>\nThe example you describe is not about \'the gcd of two unknown numbers\', it seems to be about finding the gcd of two numbers of a particular form.<br/>\nAll we can say is that 5k+3=(3k+2).1+(2k+1) and since k is integer, then also 3k+2 and 2k+1 are integer.<br/>\nIf the goal is finding gcd(3k + 2, 5k + 3), you need to continue with 3k+2=(2k+1).1+(k+1) 2k+1=(k+1).1+k k+1=k.1+1 k=1.k+0 and, therefore, gcd(3k + 2, 5k + 3)=1.</p></r>',NULL,NULL,NULL,NULL,'141.101.104.204',0,1),(37,6,15,'2021-04-13 18:58:14',33,'comment','<r><p>@<EMAIL email=\"pacheco@ipb.pt\">pacheco@ipb.pt</EMAIL>#31 <br/>\nWatch this:<br/>\n<URL url=\"https://www.physicsforums.com/threads/an-example-of-a-relation-that-is-symmetric-and-anti-symmetric.806808\">https://www.physicsforums.com/threads/an-example-of-a-relation-that-is-symmetric-and-anti-symmetric.806808</URL></p></r>',NULL,NULL,NULL,NULL,'141.101.104.204',0,1),(38,6,16,'2021-04-13 19:03:25',33,'comment','<r><p>@<EMAIL email=\"a46440@alunos.ipb.pt\">a46440@alunos.ipb.pt</EMAIL>#28 This prove relies on mathematical induction, have you learned about it?<br/>\nCheck this out:<br/>\n<URL url=\"https://www.youtube.com/watch?v=rY4af1dC1fA\">https://www.youtube.com/watch?v=rY4af1dC1fA</URL></p></r>',NULL,NULL,NULL,NULL,'141.101.104.176',0,1),(39,6,17,'2021-04-30 10:27:17',1494,'comment','<r><p>@<EMAIL email=\"pacheco@ipb.pt\">pacheco@ipb.pt</EMAIL>#11 One of the topics that I think would be interesting to explore on this platform would be the analysis of data using machine learning tools, taking into account the technological advances increasingly felt.</p></r>',NULL,NULL,NULL,NULL,'108.162.229.39',0,1),(40,8,3,'2021-04-30 10:39:09',1494,'comment','<r><p>Hello @<EMAIL email=\"perego@dima.unige.it\">perego@dima.unige.it</EMAIL>#21 for a while I used the application available on this website (<URL url=\"http://matrixcalc.org/pt/\">http://matrixcalc.org/pt/</URL>) and it seemed to work correctly.</p>  </r>',NULL,NULL,NULL,NULL,'141.101.69.146',0,1),(41,6,18,'2021-05-26 14:35:49',33,'comment','<r><p>@<EMAIL email=\"jcsmcmendes@hotmail.com\">jcsmcmendes@hotmail.com</EMAIL>#39 can you please be more specific in your question? Give us precise questions you would like to see answered and the MathE team will envolve experts to provide answers (or throw us more and more questions &#128515; ).</p></r>',NULL,NULL,NULL,NULL,'172.68.102.175',0,1),(42,6,19,'2021-05-26 15:08:47',1355,'comment','<t><p>Hello<br/>\nCan we talk a little about Graph Theory in this topic? I would like to know about \'real life\' problems that can be described using graphs. Also:<br/>\n#1 What is a complete graph?<br/>\n#2 What is a bipartite graph?<br/>\n#3 What is a complete bipartite graph?<br/>\n#4 How can a graph be represented computationally? Sure we cannot just draw the graph to give it as input in a computer program, right?<br/>\nI\'d really appreciate any help you can give.</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.91.234',0,1),(43,6,20,'2021-05-26 15:44:38',1473,'comment','<r><p>One of \'real life\' examples can be the best way of drawing subway maps,which can be easily solved using graph theory.</p>\n<UPL-IMAGE content=\"image.png\" size=\"171kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-05-26/1622043856-303212-image.png\" uuid=\"74807a05-0d52-4bb0-96cc-497e2d68a3da\"><s>[upl-image uuid=74807a05-0d52-4bb0-96cc-497e2d68a3da size=171kB url=http://localhost/mathe/student-forum/public/assets/files/2021-05-26/1622043856-303212-image.png]</s>image.png<e>[/upl-image]</e></UPL-IMAGE>\n</r>','2021-05-26 15:46:24',1473,NULL,NULL,'172.68.102.147',0,1),(44,6,21,'2021-05-26 15:46:06',1033,'comment','<r><p>@<EMAIL email=\"littleant7anos@gmail.com\">littleant7anos@gmail.com</EMAIL>#42 <br/>\nComplete bipartite graph is kind of bipartite graph where every vertex of first set is connected with every vertex of second set.</p></r>',NULL,NULL,NULL,NULL,'162.158.88.79',0,1),(45,6,22,'2021-05-26 15:46:08',1355,'comment','<r><p>@<EMAIL email=\"a46621@alunos.ipb.pt\">a46621@alunos.ipb.pt</EMAIL>#43 <br/>\nSubway maps give beautiful images. So ... what would the vertices be? And the edges?</p></r>',NULL,NULL,NULL,NULL,'162.158.89.44',0,1),(46,6,23,'2021-05-26 15:46:43',1355,'comment','<r><p>@<EMAIL email=\"bineshbasnet189@gmail.com\">bineshbasnet189@gmail.com</EMAIL>#44 <br/>\nMmmmm, what do you mean by first set and second set?</p></r>',NULL,NULL,NULL,NULL,'162.158.89.44',0,1),(47,6,24,'2021-05-26 15:49:55',1113,'comment','<r><p>@<EMAIL email=\"littleant7anos@gmail.com\">littleant7anos@gmail.com</EMAIL>#42 Hello António, regarding the bipartite graph, bipartite graph is such a graph whose graph vertices can be decomposed into two separate disjoint sets such that no two graph vertices within the same set are adjacent (connected). &#128515;</p> </r>',NULL,NULL,NULL,NULL,'162.158.90.85',0,1),(48,6,25,'2021-05-26 15:52:01',1118,'comment','<r><p>@<EMAIL email=\"littleant7anos@gmail.com\">littleant7anos@gmail.com</EMAIL>#42 Hello António Magalhães as per the question 1, A graph is said to be complete when each vertex is connected to every other vertices.</p> </r>','2021-05-26 15:53:34',1118,NULL,NULL,'172.68.102.147',0,1),(49,6,26,'2021-05-26 15:56:14',1116,'comment','<r><p>@<EMAIL email=\"littleant7anos@gmail.com\">littleant7anos@gmail.com</EMAIL>#42 <br/>\n\"Water, gas and electricity\" redirects here. For the utilities, see Public utility.**<br/>\n<URL url=\"https://en.wikipedia.org/wiki/Three_utilities_problem\">https://en.wikipedia.org/wiki/Three_utilities_problem</URL></p></r>',NULL,NULL,NULL,NULL,'172.68.102.131',0,1),(50,6,27,'2021-05-26 16:16:50',1135,'comment','<r><p>@<EMAIL email=\"littleant7anos@gmail.com\">littleant7anos@gmail.com</EMAIL>#42 Traveling salesman problem is reacurring problem that relates to every traveler that want to spend as little as possible while going to everywhere they can.<br/>\nAn example of it is this:</p>\n<UPL-IMAGE content=\"cities-example.png\" size=\"20kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-05-26/1622045298-316555-cities-example.png\" uuid=\"bd8c7eb3-8896-4ae5-a06d-2aff41e34c2b\"><s>[upl-image uuid=bd8c7eb3-8896-4ae5-a06d-2aff41e34c2b size=20kB url=http://localhost/mathe/student-forum/public/assets/files/2021-05-26/1622045298-316555-cities-example.png]</s>cities-example.png<e>[/upl-image]</e></UPL-IMAGE>\n<p>The traveler wants to go from V = {A,B,C,D,E} and back to A with spending as little as possible time going from all vertices at once.</p></r>',NULL,NULL,NULL,NULL,'172.68.102.175',0,1),(51,6,28,'2021-05-26 17:10:28',1119,'comment','<r><p>The handshaking lemma states that, if a group of people shakes hands, it is always the case that an even number of people have shaken an odd number of hands. to show this we represent people as nodes on a graph, and shaking hands is represented as a line connecting the nodes</p>  \n\n\n<p><URL url=\"https://medium.com/swlh/proving-the-handshaking-lemma-d8dd2a30752c#:~:text=Statement%20and%20Proof,as%20a%20line%20connecting%20them\">https://medium.com/swlh/proving-the-handshaking-lemma-d8dd2a30752c#:~:text=Statement%20and%20Proof,as%20a%20line%20connecting%20them</URL>.</p></r>',NULL,NULL,NULL,NULL,'172.68.102.175',0,1),(52,11,1,'2021-06-10 11:29:35',35,'comment','<t><p>It\'s that time of year! Has anyone got any good suggestions for books with mathematics as part of the storyline?</p></t>',NULL,NULL,NULL,NULL,'141.101.69.6',0,1),(53,11,2,'2021-07-08 10:02:14',35,'comment','<t><p>Has anyone read Humble Pi: A Comedy of Maths Errors by Matt Parker? #maths #books #motivation #summerreading</p></t>',NULL,NULL,NULL,NULL,'162.158.155.245',0,1),(54,11,3,'2021-07-08 10:04:08',35,'comment','<r><p>Just came across this list of recommendations for reading about maths (<URL url=\"https://www.dumblittleman.com/books-about-math/\">https://www.dumblittleman.com/books-about-math/</URL>) <br/>\nCan you add to the list?</p></r>',NULL,NULL,NULL,NULL,'162.158.158.244',0,1),(55,12,1,'2021-10-04 15:59:26',27,'comment','<t><p>What problems you have when you use Gaussian elimination method to solve linear equation 