EMAIL email=\"emaval1@ktu.lt\">emaval1@ktu.lt</EMAIL>#88 According to Britannica, the term matrix was introduced by the 19th-century English mathematician James Sylvester, but it was his friend the mathematician Arthur Cayley who developed the algebraic aspect of matrices in two papers in the 1850s.</p></r>',NULL,NULL,NULL,NULL,'162.158.89.57',0,1),(106,12,31,'2021-10-12 09:13:14',1700,'comment','<r><UPL-IMAGE content=\"245367920-916875832595236-8928114997847664124-n.jpeg\" size=\"55kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-10-12/1634029847-310877-245367920-916875832595236-8928114997847664124-n.jpeg\" uuid=\"d4e3627b-d718-4c27-b2c4-f632d50a0bfe\"><s>[upl-image uuid=d4e3627b-d718-4c27-b2c4-f632d50a0bfe size=55kB url=http://localhost/mathe/student-forum/public/assets/files/2021-10-12/1634029847-310877-245367920-916875832595236-8928114997847664124-n.jpeg]</s>245367920-916875832595236-8928114997847664124-n.jpeg<e>[/upl-image]</e></UPL-IMAGE>\n<p>How to calculate this by gauss method?</p></r>',NULL,NULL,NULL,NULL,'162.158.203.11',0,1),(107,13,22,'2021-10-12 09:14:43',27,'comment','<r><p>@<EMAIL email=\"akvbar3@ktu.lt\">akvbar3@ktu.lt</EMAIL>#84 Two options: try to eliminate some rows by using Gaussian approach, otherwise, more sophisticated way, to reduce dimension by computing adjuncts</p> </r>',NULL,NULL,NULL,NULL,'162.158.92.8',0,1),(108,13,23,'2021-10-12 09:16:28',27,'comment','<r><p>@<EMAIL email=\"ugne.mamonaite@gmail.com\">ugne.mamonaite@gmail.com</EMAIL>#86 Now they are popular in data science</p></r>',NULL,NULL,NULL,NULL,'162.158.88.158',0,1),(109,13,24,'2021-10-12 09:16:53',27,'comment','<r><p>@<EMAIL email=\"jonsil1@ktu.lt\">jonsil1@ktu.lt</EMAIL>#87 Using Gaussian elimination</p></r>',NULL,NULL,NULL,NULL,'162.158.88.158',0,1),(110,12,32,'2021-10-12 09:17:18',1707,'comment','<r><UPL-IMAGE content=\"image.png\" size=\"13kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-10-12/1634030195-874713-image.png\" uuid=\"e2797bb0-a691-461e-a40d-218f1b8d4b92\"><s>[upl-image uuid=e2797bb0-a691-461e-a40d-218f1b8d4b92 size=13kB url=http://localhost/mathe/student-forum/public/assets/files/2021-10-12/1634030195-874713-image.png]</s>image.png<e>[/upl-image]</e></UPL-IMAGE>\n<p>how do I solve this by gaussian method?</p></r>',NULL,NULL,NULL,NULL,'172.69.194.48',0,1),(111,13,25,'2021-10-12 09:20:25',27,'comment','<r><p>@<EMAIL email=\"giedruna.pavuolyte@ktu.edu\">giedruna.pavuolyte@ktu.edu</EMAIL>#90 I am citing the <URL url=\"http://mathsguideonline.weebly.com/blog/real-life-application-of-matrices-some-examples\"><s>[</s>source<e>](http://mathsguideonline.weebly.com/blog/real-life-application-of-matrices-some-examples)</e></URL>:<br/>\nSome of the main applications of matrices are briefed below:</p>\n<LIST><LI><s>- </s>In physics, matrices are applied in the study of electrical circuits, quantum mechanics and optics. In calculation of battery power outputs and resistor conversion of electrical energy into another useful energy, these matrices play a major role. Especially, in solving the problems using Kirchoff’s laws of voltage and current, the matrices are essential.</LI>\n<LI><s>- </s>Physicists and engineers model physical systems and perform precision calculations needed for complex machinery to work. Electronics, networks, airplane and spacecraft, and chemical manufacturing all require fine tuned computations arising from matrix transformations.</LI>\n<LI><s>- </s>In computer based applications, matrices play a vital role in the projection of three dimensional image into a two dimensional screen, creating the realistic seeming motions. Digital Images are spaced collection of pixels or image elements arranged in 2d space and in computers they are represented as Matrices. These matrices contain different values of integers which represent the level of brightness or intensity or similar properties.</LI>\n<LI><s>- </s>Stochastic matrices and Eigen vectors are used in page ranking algorithms used in ranking web pages in Google search. </LI>\n<LI><s>- </s>Matrices are also used for encryption of message codes. Matrices and their inverse matrices are used by a programmers for coding or encrypting a message. A message is made as a sequence of numbers in a binary format for communication and it follows code theory for solving. Hence with the help of matrices, those equations are solved. </LI>\n<LI><s>- </s>In robotics and automation, matrices are the base elements for robot movements. The movements of the robots are programmed with the calculation of matrices’ rows and columns. The inputs for controlling robots are given based on the calculations from matrices.</LI> </LIST></r>',NULL,NULL,NULL,NULL,'162.158.93.75',0,1),(112,13,26,'2021-10-12 09:20:52',27,'comment','<r><p>@<EMAIL email=\"justinasrag@gmail.com\">justinasrag@gmail.com</EMAIL>#94 Yes, if determinant is not equal to 0</p></r>',NULL,NULL,NULL,NULL,'162.158.93.75',0,1),(113,13,27,'2021-10-12 09:21:15',27,'comment','<r><p>@<EMAIL email=\"jokubas.milasevicius@ktu.edu\">jokubas.milasevicius@ktu.edu</EMAIL>#91 The product rule should help you</p></r>',NULL,NULL,NULL,NULL,'162.158.93.75',0,1),(114,12,33,'2021-10-12 09:22:40',27,'comment','<r><p>@<EMAIL email=\"jokubas.milasevicius@ktu.edu\">jokubas.milasevicius@ktu.edu</EMAIL>#110 You should rewrite in matrix form and then perform elimination procedure</p></r>',NULL,NULL,NULL,NULL,'162.158.90.68',0,1),(115,13,28,'2021-10-12 09:25:37',1710,'comment','<t><p>Where do people use matrix in real life?</p></t>',NULL,NULL,NULL,NULL,'162.158.90.68',0,1),(116,13,29,'2021-10-12 09:26:41',1710,'comment','<t><p>What is the benefits of knowing matrix?</p></t>',NULL,NULL,NULL,NULL,'162.158.91.247',0,1),(117,13,30,'2021-10-12 09:30:59',27,'comment','<r><p>@<EMAIL email=\"martynas.vezys@ktu.edu\">martynas.vezys@ktu.edu</EMAIL>#115 you can read examples above</p></r>',NULL,NULL,NULL,NULL,'162.158.203.11',0,1),(118,13,31,'2021-10-12 09:31:58',27,'comment','<r><p>@<EMAIL email=\"martynas.vezys@ktu.edu\">martynas.vezys@ktu.edu</EMAIL>#116 you benefit using them in various kind tasks or problems to be solved</p></r>',NULL,NULL,NULL,NULL,'162.158.203.37',0,1),(119,13,32,'2021-10-12 10:01:12',1714,'comment','<t><p>When searching for a determinant in say [4x4] format, to change rows you need to move up - forward? why?</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.183.239',0,1),(120,12,34,'2021-10-12 10:03:54',1714,'comment','<t><p>In which case should I use the gaussian method, and in which case can I choose other (reverse matrix...) methods?</p></t>',NULL,NULL,NULL,NULL,'162.158.183.193',0,1),(121,13,33,'2021-10-12 12:27:59',1667,'comment','<t><p>What is a unique solution in matrices?</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.91.49',0,1),(122,13,34,'2021-10-12 13:41:36',27,'comment','<r><p>@<EMAIL email=\"vilmante.kudelyte@ktu.edu\">vilmante.kudelyte@ktu.edu</EMAIL>#121 This is just one set of values for unknown variables x, y, z, ... that satisfies all equations in the system</p></r>',NULL,NULL,NULL,NULL,'162.158.92.8',0,1),(123,12,35,'2021-10-12 13:44:18',27,'comment','<r><p>@<EMAIL email=\"migsem1@ktu.lt\">migsem1@ktu.lt</EMAIL>#120 Gaussian elimination approach fits for all linear equation systems, while other approaches (Cramer, inverse matrix) requires that the number of unknown variables would be the same as the number of equations and determinant not equal to 0.</p></r>',NULL,NULL,NULL,NULL,'162.158.91.41',0,1),(124,13,35,'2021-10-12 15:21:41',1674,'comment','<t><p>Why can\'t a determinant be 0?<br/>\nAnd where can we apply Cramer\'s rule but not Gaussian elimination?</p></t>',NULL,NULL,NULL,NULL,'162.158.91.215',0,1),(125,13,36,'2021-10-12 15:32:38',1662,'comment','<t><p>Would there be any way to adapt matrix to biology/chemistry?</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.89.31',0,1),(126,13,37,'2021-10-12 15:34:19',1662,'comment','<t><p>Can we apply matrix to three-dimensional space and if yes, then in what areas it is used?</p> \n</t>',NULL,NULL,NULL,NULL,'162.158.89.31',0,1),(127,13,38,'2021-10-12 17:41:43',1670,'comment','<t><p>How to find transposed matrix?</p></t>',NULL,NULL,NULL,NULL,'162.158.92.164',0,1),(128,13,39,'2021-10-12 17:42:29',1670,'comment','<t><p>How to solve matrix in Cramer method?</p></t>',NULL,NULL,NULL,NULL,'162.158.92.164',0,1),(129,12,36,'2021-10-12 17:48:11',1652,'comment','<r><UPL-IMAGE content=\"screenshot-14.png\" size=\"43kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-10-12/1634060844-278009-screenshot-14.png\" uuid=\"0d664542-9759-437e-bf11-28aa293cf8a5\"><s>[upl-image uuid=0d664542-9759-437e-bf11-28aa293cf8a5 size=43kB url=http://localhost/mathe/student-forum/public/assets/files/2021-10-12/1634060844-278009-screenshot-14.png]</s>screenshot-14.png<e>[/upl-image]</e></UPL-IMAGE>\n<p>How to solve this in gaussian method?</p></r>',NULL,NULL,NULL,NULL,'162.158.88.158',0,1),(130,13,40,'2021-10-12 17:54:17',1652,'comment','<t><p>What is the purpose of the matrix?</p></t>',NULL,NULL,NULL,NULL,'162.158.92.8',0,1),(131,13,41,'2021-10-12 18:46:34',1708,'comment','<t><p>How to find inverse matrix?</p></t>',NULL,NULL,NULL,NULL,'141.101.77.247',0,1),(132,13,42,'2021-10-12 18:49:21',1708,'comment','<t><p>What is the easiest way to find the determinant of a matrix 3x3?</p></t>',NULL,NULL,NULL,NULL,'198.41.242.84',0,1),(133,12,37,'2021-10-12 18:54:23',27,'comment','<r><p>@<EMAIL email=\"migsem1@ktu.lt\">migsem1@ktu.lt</EMAIL>#120 Gaussian elimination can be used to solve any linear equation, while reverse matrix or Cramer only if the number of equations is equal to the number of unknown variables, also if the determinant is not equal to 0</p></r>',NULL,NULL,NULL,NULL,'162.158.203.9',0,1),(134,12,38,'2021-10-12 18:54:56',27,'comment','<r><p>@<EMAIL email=\"laura.senkute@ktu.edu\">laura.senkute@ktu.edu</EMAIL>#129 Begin with rewriting this equation using matrix notation</p></r>',NULL,NULL,NULL,NULL,'162.158.203.9',0,1),(135,13,43,'2021-10-12 18:56:34',27,'comment','<r><p>@<EMAIL email=\"emilija.bezrukovaite@ktu.edu\">emilija.bezrukovaite@ktu.edu</EMAIL>#124 If determinant is zero, then the division from zero is not allowed</p></r>',NULL,NULL,NULL,NULL,'162.158.203.9',0,1),(136,13,44,'2021-10-12 18:56:53',27,'comment','<r><p>@<EMAIL email=\"vaida.mankute@ktu.edu\">vaida.mankute@ktu.edu</EMAIL>#128 You have to apply formulas</p></r>',NULL,NULL,NULL,NULL,'162.158.203.9',0,1),(137,13,45,'2021-10-12 18:57:54',27,'comment','<r><p>@<EMAIL email=\"ievbel@ktu.lt\">ievbel@ktu.lt</EMAIL>#131 Follow the formulas step by step, but be sure that the system determinant is not equal to 0</p></r>',NULL,NULL,NULL,NULL,'162.158.203.9',0,1),(138,12,39,'2021-10-12 19:00:45',1656,'comment','<r><p>Is it more worthy to solve this with gaussian method or inverse matrix method?</p><UPL-IMAGE content=\"matrica.png\" size=\"19kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-10-12/1634065217-884114-matrica.png\" uuid=\"5f16799a-a0b0-4f0e-8480-1a0fc998b971\"><s>[upl-image uuid=5f16799a-a0b0-4f0e-8480-1a0fc998b971 size=19kB url=http://localhost/mathe/student-forum/public/assets/files/2021-10-12/1634065217-884114-matrica.png]</s>matrica.png<e>[/upl-image]</e></UPL-IMAGE>\n</r>',NULL,NULL,NULL,NULL,'198.41.242.84',0,1),(139,13,46,'2021-10-12 19:05:33',1675,'comment','<t><p>How should I know which of these two methods - Gauss or reverse matrix, in a certain situation is more appropriate to use?</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.93.75',0,1),(140,13,47,'2021-10-12 19:08:05',1656,'comment','<t><p>whether there is another way to calculate the third row determinant, then triangle rule?</p></t>',NULL,NULL,NULL,NULL,'198.41.242.106',0,1),(141,13,48,'2021-10-12 19:13:11',1675,'comment','<t><p>In which situations the matrix can\'t be calculated?</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.91.49',0,1),(142,12,40,'2021-10-12 19:48:52',1705,'comment','<t><p>Why can we only multiply matrices and can’t divide them?</p> </t>',NULL,NULL,NULL,NULL,'198.41.242.106',0,1),(143,13,49,'2021-10-12 20:33:25',1716,'comment','<t><p>what can we do with the determinant of a matrix? is it just a number or does it tell us something more?</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.183.239',0,1),(144,13,50,'2021-10-12 20:34:20',1716,'comment','<t><p>what is the easiest way to remember how to multiply matrixes?</p>\n</t>',NULL,NULL,NULL,NULL,'162.158.183.209',0,1),(145,12,41,'2021-10-13 07:33:41',27,'comment','<r><p>@<EMAIL email=\"kornelija.kalinauskaite@ktu.edu\">kornelija.kalinauskaite@ktu.edu</EMAIL>#142 It relates that the matrix product is not commutative, and instead of dividing matrices we multiply by inverse matrix from the left side or right side (it should be chosen carefully)</p></r>',NULL,NULL,NULL,NULL,'162.158.183.239',0,1),(146,13,51,'2021-10-13 07:35:04',27,'comment','<r><p>@<EMAIL email=\"tadas.magyla@ktu.edu\">tadas.magyla@ktu.edu</EMAIL>#144 I would say to exercise on doing that multiple times &#128512;</p> </r>',NULL,NULL,NULL,NULL,'162.158.183.193',0,1),(147,13,52,'2021-10-13 07:36:46',27,'comment','<r><p>@<EMAIL email=\"pausen@ktu.lt\">pausen@ktu.lt</EMAIL>#141 Matrix is the structure to organise data. Then, we use matrices to perform calculations depending on the task.</p> </r>',NULL,NULL,NULL,NULL,'162.158.183.209',0,1),(148,13,53,'2021-10-13 07:38:19',27,'comment','<r><p>@<EMAIL email=\"pausen@ktu.lt\">pausen@ktu.lt</EMAIL>#139 Gaussian elimination can be used for all linear equation system, while inverse matrix approach only when the number of equations is equal to the number of unknown variables and determinant not equal to 0</p></r>',NULL,NULL,NULL,NULL,'162.158.183.209',0,1),(149,6,29,'2021-10-13 10:06:28',1666,'comment','<t><p>A bit off-topic, but i was wondering whether we could write a function defining a curve of a projectile with variable parameters for starting velocity, angle and gravity acceleration (to make things simple, no drag coef. included)? It would make calculations easy as all you need to do is throw parameters and read the graphic output. In graph, X would show distance and Y would show height at given distance.</p></t>',NULL,NULL,NULL,NULL,'172.69.194.60',0,1),(150,6,30,'2021-10-24 15:17:54',1730,'comment','<t><p>b = c- d <br/>\n7/3*x(elevado a 2)-1 = 5</p></t>',NULL,NULL,NULL,NULL,'172.68.102.182',0,1),(151,6,31,'2021-10-25 14:30:21',1721,'comment','<r><p>Hi,<br/>\nfor z1=a1+b1<EM><s>*</s>i and z2=a2+b2<e>*</e></EM>i, can I use the type z1<EM><s>*</s>z2=a1<e>*</e></EM>a2+a1<EM><s>*</s>b2<e>*</e></EM>i+b1<EM><s>*</s>i<e>*</e></EM>a2+b1<EM><s>*</s>i<e>*</e></EM>b2<EM><s>*</s>i? Or there are some cases where the results came up only with type: z1<e>*</e></EM>z2=(a1<EM><s>*</s>a2-b1<e>*</e></EM>b2)+(a1<EM><s>*</s>b2+a2<e>*</e></EM>b1)*i<br/>\nThe result is the same.<br/>\nThank you</p></r>',NULL,NULL,NULL,NULL,'172.68.102.174',0,1),(152,6,32,'2021-10-25 15:15:20',1731,'comment','<r><p>Solve for x:<br/>\n2x/4=3x<SUP><s>^</s>3</SUP><br/>\nYour answer is WRONG:<br/>\nx=0<br/>\nThe correct answer iS:<br/>\nIx€ {0, ‡0.17}</p></r>',NULL,NULL,NULL,NULL,'172.68.102.130',0,1),(153,6,33,'2021-11-10 12:09:20',33,'comment','<r><p>@<EMAIL email=\"konparag@gmail.com\">konparag@gmail.com</EMAIL>#151 <br/>\nI suggest not memorizing the formula for multiplying complex numbers in the algebraic form and instead, when you need to multiply, use the distributive property.<br/>\nFor example:<br/>\n(1-i)(1+2i)=1+2i-i-2i<SUP><s>^</s>2</SUP>=1+2i-i+2=3+i<br/>\nDo you see what I mean?</p></r>',NULL,NULL,NULL,NULL,'172.68.102.182',0,1),(154,11,4,'2021-11-12 01:27:04',1720,'comment','<r><i>    </i><CODE>                                             _**Muhammad ibn Musa al-Khwarizmi**_\n<i>    </i>                                                **Father of Algebra and Algorithm** </CODE>\n\n<p>al-Khawarizmi was a genius mathematician during the golden age of Islam. He was born in 780 CE in a place called Khwarazm located in present Uzbekistan. He was also appointed as a head of the library of the House of Wisdom in Baghdad.</p>\n\n<p>Many of his books were translated into Latin and used as a principle mathematical text book in European universities until the 16th century. Among them these two books had an important place: Kitab al-Jama wal-Tafreeq bil Hisab al-Hindi and Kitab al-Jabr wa al-muqabala.</p>\n\n<p>al-Khawarizmi presented the first systematic solution of linear and quadratic equations by completing the square, for which he provided geometric justifications.<br/>\nHe was the first to treat algebra as an independent discipline and introduce the methods of “Reduction” and “Balancing.”</p> \n\n<p>Al- Khawarizmi´s method of solving linear and quadratic equation worked by first reducing the equation to one of six standard form (where b and c are positive integer)</p>\n\n<LIST><LI><s>- </s>squares equal roots (ax²  = bx)</LI>\n<LI><s>- </s>squares equal number (ax² = bx)</LI>\n<LI><s>- </s>roots equal number (bx=c)</LI>\n<LI><s>- </s>squares and roots equal to number (ax² + bx = c)</LI>\n<LI><s>- </s>squares and number equal to roots (ax² + c = bx)</LI>\n<LI><s>- </s>roots and numbers equal to squares (ax² = bx + c)</LI> </LIST>\n\n<p>x²+ 10x = 39<br/>\n⇒ x²+ 10x + 25 = 39 + 25         <br/>\n⇒ (x + 5)²   = 64<br/>\n⇒ x + 5 = 8<br/>\n⇒ x =3</p>\n\n<p>Modern mathematics dictates that the quadratic equation has two solutions. One is positive and another one is negative. al-Khawarizmi was working with only the positive solutions, since the area and length can not negative.</p>\n\n<QUOTE><i>&gt; </i><p>\"al-Khwarizmi begins by constructing a square with side lengths x and are x². Then he constructs four rectangles with side lengths x and 5/2 and area 5x/2 . This polygon represents the x² + 10x part of the equation. Al-Khwarizmi then completes the large square by adding four smaller squares with side lengths 5/2 and area 25/4 .”</p></QUOTE>\n\n<p><IMG alt=\"https://www.bing.com/images/search?view=detailV2&amp;ccid=pktb0N84&amp;id=672F177754EA8BD30BEAB247239BB70415245AA9&amp;thid=OIP.pktb0N84y1ffjU5w2pX6YwHaHl&amp;mediaurl=https%3a%2f%2fi.pinimg.com%2f736x%2fb1%2fd7%2f0c%2fb1d70c4ec584c6ec47577aafb1529796--equation-algebra.jpg&amp;cdnurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.a64b5bd0df38cb57df8d4e70da95fa63%3frik%3dqVokFQS3myNHsg%26pid%3dImgRaw%26r%3d0&amp;exph=410&amp;expw=400&amp;q=al+khawarizmi+geometric+image&amp;simid=608055506850680492&amp;FORM=IRPRST&amp;ck=3CF4A3125273EE66C63C567C22228D35&amp;selectedIndex=30&amp;ajaxhist=0&amp;ajaxserp=0\" src=\"src\"><s>![</s>https://www.bing.com/images/search?view=detailV2&amp;ccid=pktb0N84&amp;id=672F177754EA8BD30BEAB247239BB70415245AA9&amp;thid=OIP.pktb0N84y1ffjU5w2pX6YwHaHl&amp;mediaurl=https%3a%2f%2fi.pinimg.com%2f736x%2fb1%2fd7%2f0c%2fb1d70c4ec584c6ec47577aafb1529796--equation-algebra.jpg&amp;cdnurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.a64b5bd0df38cb57df8d4e70da95fa63%3frik%3dqVokFQS3myNHsg%26pid%3dImgRaw%26r%3d0&amp;exph=410&amp;expw=400&amp;q=al+khawarizmi+geometric+image&amp;simid=608055506850680492&amp;FORM=IRPRST&amp;ck=3CF4A3125273EE66C63C567C22228D35&amp;selectedIndex=30&amp;ajaxhist=0&amp;ajaxserp=0<e>](src)</e></IMG></p>\n\n<p>al-Khawarizmi was also famous for the decimal number system including the adaptation of Zero (0). Mainly this decimal system was first introduced in Hindustan (India) . While working with Brahmagupta (a famous mathematician) they complete the decimal number system. Besides al-Khawarizmi was the first to introduce the term Algorithm (process to solve a problem) <br/>\nLater on al-Khawarizmi introduced this Hindu number system to the muslim world and after 600 years this number system was introduced in Europe. During that time Roman number system was used in Europe but to do a big calculation it takes much space and time. <br/>\nAs a result when al-Khawarizmi introduced the decimal number system in Europe it became so popular.<br/>\nAlong with it, al-Khawarizmi has also made huge contributions in the field of  Astronomy and Geography.</p>\n\n</r>',NULL,NULL,NULL,NULL,'162.158.222.142',0,1),(155,11,5,'2021-11-16 20:57:05',1773,'comment','<r><LIST><LI><s>- </s>Why Do We Study Mathematics?</LI></LIST>\n\n<p>There are many answers to this question. Some would think that it’s just to pass the next quiz or final examination so they can move on to the next course in their program of study. Others will say it is totally unnecessary; and still others will claim they need math to balance checkbooks or for a promotion… There isn’t a single answer that fully addresses the question, but there are many reasons that every student will come to appreciate math as they move forward with their academic endeavors.</p>\n\n\n<LIST><LI><s>- </s>Using Math in Everyday Life:</LI></LIST>\n\n<p>Mathematics is an essential discipline in today’s world. It is a powerful tool for understanding the world around us and our perspective of the important issues facing us as individuals, families, businesses, and nations. Math surrounds us; we see and use math skills and capabilities every day–from balancing our checkbooks to advertising agencies to doctors; from retailers to builders, lawyers and accountants. Everyone needs some level of specific mathematics knowledge. Most professions use math to perform their job better and to get ahead in the world.</p>\n\n<LIST><LI><s>- </s>Analytic Skills Obtained from Math in School:</LI></LIST>\n\n<p>To succeed in college, there are general education mathematics requirements that help students develop critical thinking and quantitative analysis skills. Every university has general knowledge course requirements. These general education courses develop the skills that students need during their more specific program courses. The general courses include computational skills, problem solving, data analysis, pattern recognition, and learning how to approach and solve complex problems.</p>\n\n<LIST><LI><s>- </s><p>Some mathematics courses are required as prerequisites for certain courses in your degree program. You won’t be able to register for and pass some upper-level courses in your degree program unless you learn the required math concepts used in those courses. As an example, a student studying orbital dynamics must have a firm understanding of algebra and trigonometry, and a social scientist needs to comprehend the foundations of statistical analysis. As you proceed toward your degree, you will find that you need the technical and computational skills learned during your mathematics courses.</p></LI>\n\n<LI><s>- </s><p>Technology and Logic:</p></LI></LIST>\n\n<p>Technology is changing rapidly and the basis of many of these technological changes is mathematics and logic. These changes are so rapid that it would be difficult to predict the skills that people will need in the future workplace or at home in the coming years. But a good basis in mathematics, statistics, and technology will keep you agile enough to adapt to the advances in technology.</p>\n\n<LIST><LI><s>- </s>Blending Historically Implied Math with Current Concepts:</LI></LIST>\n\n<p>Mathematics has evolved over many centuries to help solve problems. Math teaches us to think logically; to identify and state the problem clearly; to plan how to solve the problem; and then to apply the appropriate methods to evaluate and solve the problem.</p>\n\n<LIST><LI><s>- </s><p>We learn to evaluate and draw conclusions based on our knowledge. We are surrounded by a large number of statistical data and studies. To be a successful student and also an informed citizen, we should be able to evaluate these studies and the data they present in order to decide what is true or reasonable. Mathematics help you recognize mistakes in thinking or analysis that we encounter in our lives. How many advertisements or political polls have you seen lately? Do you have the quantitative skills to evaluate their messages? Mathematics can help.</p></LI>\n\n<LI><s>- </s><p>Where Else is Math Applicable?</p></LI></LIST>\n\n<p>Math is more than a subject that everyone in school needs to take. Many believe that math is only needed in the Science, Technology Engineering and Mathematics fields (STEM). That’s true, math is absolutely essential in those fields, but it is also needed in many other fields including economics, many of the social sciences such as psychology and sociology, and in many of the arts and humanities disciplines including art, music, and mass communications. Mathematics has been called “the universal language”.</p>\n\n<LIST><LI><s>- </s><p>Numbers and mathematics help us keep score–not just in sports contests, but in measuring money, time, distance, cooking and baking, balancing a checkbook, planning an improvement project, and buying the necessary materials. Building a new deck on your house or finding the amount of material to build a fence are both good examples of mathematics in our daily lives.</p></LI>\n\n<LI><s>- </s><p>Logic and quantitative reasoning attained in mathematics courses helps us make better decisions. Learning how to solve the hard challenges is an asset that will pay dividends throughout our lives. These challenges may be a complex statistical analysis or one of the many challenges you face in your life.</p></LI>\n\n<LI><s>- </s><p>We also use numbers and mathematics for leisure. We play card games, electronic games, crossword puzzles, and Sudoku’s. They all share a common element of mathematics.</p></LI>\n\n<LI><s>- </s><p>In summary, a solid foundation in mathematics is an essential skill for students pursuing any academic degree and that same quantitative capability is necessary for success in life as well. University mathematics courses prepare students for both of those very important reasons.</p></LI></LIST>\n</r>','2021-11-16 21:08:54',1773,NULL,NULL,'172.68.102.182',0,1),(156,11,6,'2021-11-16 22:57:20',1722,'comment','<t><p>The Hidden Figures tells the powerful based on true story of a group of female African-American mathematicians who worked on the first US space programme. The movie gives a shout-out to Euler’s Method a centuries-old math technique.<br/>\nIn my opinion the role played of the Katherine Johnson, a mathematician who was of NASA’s human “Computers” and an unsung hero of the space agency’s. in this movie, the head of the programme, played by Kevin, calls for an expert in analytic geometry when it becomes apparent that his team are unable to calculate the trajectories needed for safe re-entry of the US space flights. Katherine studied how to use geometry for space travel, and she used to calculate by her own hands. She used those skills to check the computer calculations for John Glenn’s orbit the earth. She used them again to help determine the trajectory for the 1969 Apollo 11 flight to the moon. She figured out the paths for the spacecraft to orbit Earth. NASA used Katherine\'s math, and it worked! NASA sent astronauts into orbit around Earth.<br/>\nDuring a pivotal scene, Johnson and a team of white, male engineers are staring at a blackboard, trying to solve equations for the trajectory of astronaut john Glenn’s space capsule.<br/>\nWhat does this have to do with linear algebra? First of all we will see that characteristic polynomials of matrices are polynomials. We need to factor them in order to find the eigenvalues. We will also see that if we take a polynomial of differential operators, the factorization allows us to solve differential equations.</p>\n \n<p>They are nonlinear but we will cover some nonlinear equations also in our course. Still, the Kepler problem can actually (with some clever transformation) be reduced to a Harmonic oscillator, which is a linear ODE. We see Catherine also work on some differential equations on the large blackboard.</p>\n</t>',NULL,NULL,'2021-11-16 22:57:51',1722,'172.68.102.146',0,1),(157,11,7,'2021-11-16 23:06:14',1722,'comment','<r><p>Is Movie “Hidden Figures” Related with Mathematics?<br/>\nThe Hidden Figures tells the powerful based on true story of a group of female African-American mathematicians who worked on the first US space programme. The movie gives a shout-out to Euler’s Method a centuries-old math technique.<br/>\nIn my opinion the role played of the Katherine Johnson, a mathematician who was of NASA’s human “Computers” and an unsung hero of the space agency’s. in this movie, the head of the programme, played by Kevin, calls for an expert in analytic geometry when it becomes apparent that his team are unable to calculate the trajectories needed for safe re-entry of the US space flights. Katherine  studied how to use geometry for space travel, and she used to calculate by her own hands. She used those skills to check the computer calculations for John Glenn’s orbit the earth. She used them again to help determine the trajectory for the 1969 Apollo 11 flight to the moon. She figured out the paths for the spacecraft to orbit Earth. NASA used Katherine\'s math, and it worked! NASA sent astronauts into orbit around Earth.<br/>\nDuring a pivotal scene, Johnson and a team of white, male engineers are staring at a blackboard, trying to solve equations for the trajectory of astronaut john Glenn’s space capsule.</p>\n<UPL-IMAGE content=\"image.png\" size=\"23kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-11-16/1637103720-526110-image.png\" uuid=\"37cdbfaf-682c-4e40-bc2d-f5e9d8fbdf7f\"><s>[upl-image uuid=37cdbfaf-682c-4e40-bc2d-f5e9d8fbdf7f size=23kB url=http://localhost/mathe/student-forum/public/assets/files/2021-11-16/1637103720-526110-image.png]</s>image.png<e>[/upl-image]</e></UPL-IMAGE>\n\n<p>What does this have to do with linear algebra? First of all we will see that characteristic polynomials of matrices are polynomials. We need to factor them in order to find the eigenvalues. We will also see that if we take a polynomial of differential operators, the factorization allows us to solve differential equations.</p>\n \n <UPL-IMAGE content=\"image.png\" size=\"34kB\" url=\"http://localhost/mathe/student-forum/public/assets/files/2021-11-16/1637103692-70902-image.png\" uuid=\"3ac9605a-9465-4944-b36f-25c1ec0356e2\"><s>[upl-image uuid=3ac9605a-9465-4944-b36f-25c1ec0356e2 size=34kB url=http://localhost/mathe/student-forum/public/assets/files/2021-11-16/1637103692-70902-image.png]</s>image.png<e>[/upl-image]</e></UPL-IMAGE>\n\n<p>They are nonlinear but we will cover some nonlinear equations also in our course. Still, the Kepler problem can actually (with some clever transformation) be reduced to a Harmonic oscillator, which is a linear ODE. We see Catherine also work on some differential equations on the large blackboard.<br/>\nAt that time also during the period where black and white people were discriminated at that time they played an important role in NASA and made a great achievement in the history of America with the help of Mathematics.</p>\n\n</r>',NULL,NULL,NULL,NULL,'172.68.102.146',0,1),(158,11,8,'2021-11-17 20:28:42',1721,'comment','<t><p>The Imitation Game</p>\n\n<p>The Imitation Game is a 2014 British historical drama film directed by Morten Tyldum and written by Graham Moore, based on the 1983 biography Alan Turing: The Enigma by Andrew Hodges. It is based on the real-life story of legendary cryptanalyst Alan Turing. In 1939, during the darkest days of World War II, the Nazis used secret codes to communicate (about their attacks etc.). One of these codes was named Enigma which cryptanalysts had thought unbreakable. The newly created British intelligence agency MI6 recruits Cambridge mathematics alumnus Alan Turing and his brilliant team of code-breakers to crack Nazi codes at Cypher School of Bletchley Park, including Enigma. Turing builds a machine, which he names Christopher, with the help of Winston Churchill who funds it. But it can’t decipher the Enigma encryption settings quickly enough and the Germans reset it each day. After overhearing a conversation with a female clerk about messages she receives, Turing has an epiphany, realising he can program the machine to decode words he already knows exist in certain messages. He recalibrates the machine and it quickly decodes and analyses messages, but he realises that if they act on every decoded message the Germans will realise that Enigma has been broken. Turing and his team decide to inform the British agency when the Germans prepare an important attack. Turing and team succeed and become heroes, but in 1952, the quiet genius encounters disgrace when authorities reveal he is gay. and send him to prison. Turing is convicted of gross indecency and, in lieu of a jail sentence, undergoes chemical castration so he can continue his work. Clarke visits him in his home and witnesses his physical and mental deterioration. The epilogue reveals that after a year of government-mandated hormonal therapy, Turing committed suicide on June 7, 1954. In 2013, Queen Elizabeth II granted Turing a posthumous Royal Pardon.</p>\n</t>',NULL,NULL,NULL,NULL,'172.68.102.130',0,1),(159,14,1,'2021-12-27 22:29:19',19,'comment','<r><p>See <URL url=\"https://www.wikihow.com/Be-Good-at-Mathematics\"><s>[</s>https://www.wikihow.com/Be-Good-at-Mathematics<e>](https://www.wikihow.com/Be-Good-at-Mathematics)</e></URL></p></r>',NULL,NULL,NULL,NULL,'188.114.111.201',0,1);
